import React, { useState, useEffect } from "react";
import Sidebar from "../components/Sidebar";
import styled from "styled-components";
import { FaCalendarAlt, FaTrophy } from "react-icons/fa";

const images = [
    "/images/image1.jpg",
    "/images/image2.jpg",
    "/images/image3.jpg",
    "/images/image4.jpg",
    "/images/image5.jpg",
    "/images/image6.jpg",
    "/images/image7.jpg",
    "/images/image8.jpg",
    "/images/image9.jpg",
    "/images/image10.jpg",
    "/images/image11.jpg",
    "/images/image12.jpg",
  ];
  
// Styled components
const DashboardContainer = styled.div`
  display: flex;
  height: 100vh;
  background: url(${(props) => props.background}) center/cover no-repeat;
  position: relative;
`;

const Overlay = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: rgba(0, 0, 0, 0.6); /* Add dark overlay */
`;

const Content = styled.div`
  margin-left: ${(props) => (props.sidebarOpen ? "200px" : "60px")};
  padding: 20px;
  width: 100%;
  z-index: 2;
  position: relative;
  transition: margin-left 0.3s ease;
  color: white;
`;

const Header = styled.div`
  display: flex;
  justify-content: space-between;
  align-items: center;
  background-color: rgba(255, 255, 255, 0.1);
  padding: 15px;
  border-radius: 8px;
  margin-bottom: 20px;
  color: white;
`;

const Section = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: 20px;
`;

const Card = styled.div`
  flex: 1 1 calc(50% - 20px); /* Two cards per row */
  background: rgba(255, 255, 255, 0.2);
  border-radius: 8px;
  padding: 20px;
  box-shadow: 0 4px 8px rgba(0, 0, 0, 0.2);
  display: flex;
  flex-direction: column;
  align-items: flex-start;
  color: white;
`;

const CardHeader = styled.div`
  display: flex;
  align-items: center;
  gap: 10px;
  font-size: 20px;
  font-weight: bold;
`;

const CardContent = styled.div`
  margin-top: 10px;
  font-size: 16px;
  line-height: 1.5;
`;

function Dashboard() {
  const [sidebarOpen, setSidebarOpen] = useState(true);
  const [background, setBackground] = useState("");

  useEffect(() => {
    const randomImage = images[Math.floor(Math.random() * images.length)];
    setBackground(randomImage);
  }, []);

  return (
    <DashboardContainer background={background}>
      <Overlay />
      <Sidebar isOpen={sidebarOpen} toggleSidebar={() => setSidebarOpen(!sidebarOpen)} />
      <Content sidebarOpen={sidebarOpen}>
        <Header>
          <h2>Dashboard</h2>
          <input
            type="search"
            placeholder="Search something..."
            style={{
              padding: "10px",
              borderRadius: "4px",
              border: "none",
              outline: "none",
            }}
          />
        </Header>
        <Section>
          <Card>
            <CardHeader>
              <FaCalendarAlt />
              Upcoming Race
            </CardHeader>
            <CardContent>
              <p><strong>Name:</strong> Nurburgring Endurance</p>
              <p><strong>Date:</strong> Dec 15, 2024</p>
              <p><strong>Car:</strong> Porsche 911 GT3</p>
            </CardContent>
          </Card>
          <Card>
            <CardHeader>
              <FaTrophy />
              Your Performance
            </CardHeader>
            <CardContent>
              <p><strong>Last Race:</strong> 2nd Place</p>
              <p><strong>Total Races:</strong> 23</p>
              <p><strong>Tracks Raced On:</strong> 10</p>
            </CardContent>
          </Card>
        </Section>
      </Content>
    </DashboardContainer>
  );
}

export default Dashboard;
